import React from 'react';
import { Layout, Header, Navigation, Drawer, Content } from 'react-mdl';
import './App.css';
import Home from './components/home';
import {Link} from 'react-router-dom';
import './index.css';

class App extends React.Component {
  constructor(props){
    super(props);
    this.state={
      style:null,
    }
  }

  toggle(position){
     if(this.state.style === position){
       this.setState({style:''});
       console.log("toggleif")
     }
     else{
      this.setState({style:position});
      console.log("toggleelse")

     }
  }

  myStyle(position){
    if(this.state.style === position){
      return "color";
      console.log("toggleif")

    }
    else{
      return "";
    }
  }

  render(){   
  return (    
        <div className="demo-big-content">
      <Layout className="header-gradient">
        <Header className="header-gradient" title={<Link style={{textDecoration:'none', color:'white'}} to='/'>Ankit Bansal</Link>} scroll>
            <Navigation> 
                <Link to="/about" onClick={()=>this.toggle(0)} className={()=>this.myStyle(0)}>About</Link>
                <Link to="/projects">Projects</Link>
                <Link to="/resume">Resume</Link>
                <Link to="/contacts">Contacts</Link>
            </Navigation>
        </Header>
        <Drawer >
            <Navigation>
               <Link to="/about">About</Link>
                <Link to="/projects">Projects</Link>
                <Link to="/resume">Resume</Link>
                <Link to="/contacts">Contacts</Link>
            </Navigation>
        </Drawer>
        <Content>  
            <Home />
        </Content>    
    </Layout>   
    </div>

  );
  }
}

export default App;
